import {
  SimpleGrid,
  Stack,
  Input,
  Textarea,
  InputLeftElement,
  InputGroup,
} from "@chakra-ui/react";
import { EmailIcon, PhoneIcon } from "@chakra-ui/icons";
import React from "react";

const ContactForm = () => {
  return (
    <SimpleGrid
      direction="column"
      columns={1}
      spacing={8}
      bg="gray.main"
      p="8"
      borderRadius="15"
    >
      <Stack direction="row" spacing={3}>
        <Input variant="filled" placeholder="Name" />
        <Input variant="filled" placeholder="Last" />
      </Stack>
      <Stack spacing={8}>
        <InputGroup>
          <InputLeftElement
            pointerEvents="none"
            children={<EmailIcon color="gray.light" />}
          />
          <Input type="email" variant="filled" placeholder="Email" />
        </InputGroup>
        <InputGroup>
          <InputLeftElement
            pointerEvents="none"
            children={<PhoneIcon color="gray.light" />}
          />
          <Input variant="filled" type="tel" placeholder="Phone number" />
        </InputGroup>

        <Textarea variant="filled" placeholder="Message" />
      </Stack>
    </SimpleGrid>
  );
};

export default ContactForm;
